import Grid from '@mui/material/Grid';
import Card from '../UI/Card';
import theme from '../UI/Theme';

import classes from "./NewsEvents.module.css";

const NewsEvents = () => {
  return (
    <Grid 
      container 
      spacing={12} 
      direction="row" 
      sx={{
        paddingLeft: "7%", 
        paddingRight: "7%",
        paddingTop: "5%",
        paddingBottom: "5%",
        [theme.breakpoints.down("md")]: {
          paddingTop: "2px"
           }
        }}>
      <Grid container item direction="column" xs={12} md={4}>
        <Grid item>
          <h2>Our News</h2>
        </Grid>
        <Grid item>
          <p>Amet nullam fringilla nibh nulla convallis tique ante sociis accumsan. <span className={classes.subtitle}>5 minutes ago</span></p>
        </Grid>
        <Grid item sx={{borderTop: "solid 1px rgba(128, 128, 128, 0.2)"}}>
          <p>Amet nullam fringilla nibh nulla convallis tique ante sociis accumsan. <span className={classes.subtitle}>20 minutes ago</span></p>
        </Grid>
        <Grid item sx={{borderTop: "solid 1px rgba(128, 128, 128, 0.2)"}}>
          <p>Amet nullam fringilla nibh nulla convallis tique ante sociis accumsan. <span className={classes.subtitle}>2 hours ago</span></p>
        </Grid>
        <Grid item sx={{borderTop: "solid 1px rgba(128, 128, 128, 0.2)"}}>
          <p>Amet nullam fringilla nibh nulla convallis tique ante sociis accumsan. <span className={classes.subtitle}>8 minutes ago</span></p>
        </Grid>
      </Grid>
      <Grid 
        container 
        item 
        direction="row" 
        xs={12} 
        md={8} 
        spacing={2}
        sx={{
          [theme.breakpoints.down("md")]: {
          marginLeft: "auto",
          marginRight: "auto",
          paddingTop: "12px"
          },
          [theme.breakpoints.down("xs")]: {
           paddingTop: "12px"
            }
        }}
      >
        <Grid item xs={12} md={12} sx={{paddingLeft: "0px"}}>
        <h2>Latest Events</h2>
        </Grid>
        <Grid item xs={12} md={6}>
          <Card />
        </Grid>
        <Grid item xs={12} md={6}>
          <Card />
        </Grid>
      </Grid>     
    </Grid>
  )
};

export default NewsEvents;
